import React from 'react';
import {Component} from 'react';
import { add_place } from '../store/itineraray';

class Button extends Component {
    constructor(props) {
        super(props);
        this.add_place = this.add_place.bind(this);
    }

    render() {
        const { place, selected } = this.props;
        return (
            <button onClick = {(e) => {e.preventDefault(); add_place(place); console.log(selected)}} className="button-addToTrip">Add to trip</button>
        )
    }
}

const mapStateToProps = state => {
    return {
        selected: state.itinerary.selected_list
    };
}

const mapDispatchToProps = dispatch => {
    return {
        add_place: (place) => {
            dispatch(add_place(place));
        }
    }
}

export default (mapStateToProps, mapDispatchToProps)(Button);
